import React from "react";
import "./Projects.css";

const projects = [
  {
    image: require("../images/Services/P1.jpg"),
    title: "My Home, Pamuru",
    description: "A modern luxury villa with eco-friendly features and smart home technology.",
  },
  {
    image: require("../images/Services/P2.jpg"),
    title: "Corporate Office Complex",
    description: "A state-of-the-art office complex for a leading tech company.",
  },
  {
    image: require("../images/Services/P3.jpg"),
    title: "Industrial Warehouse",
    description: "A large-scale warehouse with advanced logistics and safety systems.",
  },
  {
    image: require("../images/Services/P4.jpg"),
    title: "Residential Complex",
    description: "Modern residential complex with premium amenities and sustainable design.",
  },
  {
    image: require("../images/Services/P5.jpg"),
    title: "Commercial Plaza",
    description: "Contemporary commercial plaza featuring retail spaces and office facilities.",
  },
  {
    image: require("../images/Services/P6.jpg"),
    title: "Mixed-Use Development",
    description: "Innovative mixed-use development combining residential and commercial spaces.",
  },
];

function Projects() {
  return (
    <div className="projects-root">
      <h1 className="projects-title">Our Projects</h1>
      <div className="projects-grid">
        {projects.map((project, idx) => (
          <div key={idx} className="project-card">
            <img src={project.image} alt={project.title} className="project-image" />
            <div className="project-content">
              <h3 className="project-title">{project.title}</h3>
              <p className="project-desc">{project.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Projects;
